import React, { useState, useEffect } from 'react';
import SearchBar from './components/SearchBar';
import MobileCard from './components/MobileCard';
import BookingForm from './components/BookingForm';

const App = () => {
    const [mobiles, setMobiles] = useState([]);
    const [showForm, setShowForm] = useState(false);
    const [selectedMobile, setSelectedMobile] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState('');

    useEffect(() => {
        fetchMobiles();
    }, []);

    const fetchMobiles = async (query = '') => {
        setLoading(true);
        setError('');
        const endpoint = query
            ? `http://127.0.0.1:8000/api/phones?search=${query}`
            : `http://127.0.0.1:8000/api/phones`;

        try {
            const response = await fetch(endpoint);
            if (!response.ok) throw new Error('Failed to fetch data');
            const data = await response.json();
            if (data.message === 'No phones found') {
                setMobiles([]);
                setError('No phones found');
            } else {
                setMobiles(data);
            }
        } catch (err) {
            setError('Failed to fetch data. Please try again.');
        } finally {
            setLoading(false);
        }
    };

    const handleSearch = (query) => {
        fetchMobiles(query);
    };

    const handleBooking = async (details) => {
        const bookingDetails = { ...details, phoneId: selectedMobile.id };
        try {
            const response = await fetch('http://127.0.0.1:8000/api/book', {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify(bookingDetails),
            });

            if (response.ok) {
                alert('Booking successful!');
                setShowForm(false);
            } else {
                throw new Error('Booking failed');
            }
        } catch {
            alert('Error while booking.');
        }
    };

    return (
        <div className="container mt-4">
            <h1 className="text-center">MOBILE STORE</h1>
            <SearchBar onSearch={handleSearch} />
            <div className="row mt-4">
                {loading ? (
                    <div>Loading...</div>
                ) : error ? (
                    <div className="text-danger">{error}</div>
                ) : mobiles.length ? (
                    mobiles.map((mobile) => (
                        <div key={mobile.id} className="col-md-4 mb-4">
                            <MobileCard mobile={mobile} onBook={() => {
                                setSelectedMobile(mobile);
                                setShowForm(true);
                            }} />
                        </div>
                    ))
                ) : (
                    <div>No phones found</div>
                )}
            </div>
            {showForm && (
                <BookingForm
                    show={showForm}
                    onClose={() => setShowForm(false)}
                    onSubmit={handleBooking}
                />
            )}
        </div>
    );
};

export default App;
